import React from "react";
import ReactDOM from "react-dom";
import "./PortfolioPage.css";

class PortfolioPage extends React.Component {
  render() {
    return (
      <div>
        <div className="jumbotron" id="jumbo-potfolio">
          <div>Portfolio</div>
        </div>
      </div>
    );
  }
}

export default PortfolioPage;
